const Home = () => {
    return(
        <div className="h-full w-full flex">
            <div className="h-full w-1/5 bg-black flex flex-col justify-between pb-10">
                <div>
                <div className="logoDiv p-6 ">
                    <img src={spotify_logo}
                     alt = "spotify logo"
                      width={125} />
                </div>
                <div className="py-5">
                    <IconText
                        iconName={"material-symbols:home"}
                        displayText={"Home"}
                        active
                    />

                   <IconText
                        iconName={"carbon:search"}
                        displayText={"Search"}
                    />

                    <IconText
                        iconName={"fluent:library-28-filled"}
                        displayText={"Your Library"}
                    />
                </div>
                <div className="pt-4">
                <IconText
                        iconName={"ph:plus-fill"}
                        displayText={"Create Playlist"}
                    />

                <IconText
                        iconName={"mdi:heart-box"}
                        displayText={"Liked Songs"}
                    />
                </div>
                </div>
                <div className="px-1">
                    <div className="text-gray-400 flex px-2 py-1 space-between hover:border-white cursor-pointer">
                            <div className="text-xs font-regular">
                                Legal
                            </div>
                            <div className="ml-2 text-xs font-regular">
                                Privacy Center
                            </div>
                            <div className="ml-2 text-xs font-regular">
                                Privacy Policy
                            </div> 
                    </div>
                    <div className="text-gray-400 flex px-2 py-1 space-between hover:border-white cursor-pointer">
                            <div className="text-xs font-regular">
                                Cookies
                            </div>
                            <div className="ml-2 text-xs font-regular">
                                About Ads
                            </div>
                    </div>
                </div>
                <div className="px-5">
                    <div className="border border-gray-100 text-white w-2/5 flex px-2 py-1 rounded-full items-center justify-center hover:border-white cursor-pointer">
                        <Icon icon ="system-uicons:globe" />
                            <div className="ml-2 text-sm font-semibold">
                                English
                            </div>
                    </div>
                </div>
        </div>
            <div className="h-full w-4/5 bg-app-black overflow-auto">
                <div className="navbar w-full h-1/10 bg-black bg-opacity-30 flex items-center justify-end">
                    <div className="w-1/2 flex h-full">
                        <div className="w-3/5 flex justify-around items-center">
                            <TextWithHover displayText={"Premium"} />
                            <TextWithHover displayText={"Support"} />
                            <TextWithHover displayText={"Download"} />
                            <div className="h-1/2 border-r border-white"></div>
                    </div>
                    <div className="w-2/5 flex justify-around h-full items-center">
                    <Link to ="/signup">   <TextWithHover displayText={"Sign Up"} /></Link>
                        <div className="bg-white h-2/3 px-8 flex items-center justify-center rounded-full font-semibold cursor-pointer">
                <Link to="/login">Log In</Link>
                        
                    </div>
                </div>
            </div>
        </div>
                <div className="content p-8 pt-0 overflow-auto">
                    <PlaylistView
                         titleText="Focus" 
                         cardsData={focusCardsData} 
                    />
                    <PlaylistView 
                        titleText="Spotify Playlists" 
                        cardsData={spotifyPlaylistCardsData} 
                    />
                    <PlaylistView
                         titleText="Sound of India" 
                         cardsData={bestOfArtistsCardsData} 
                    />
                </div>
            </div>
        </div>
    );
};

const PlaylistView = ({titleText, cardsData}) => {
    return(
        <div className="text-white mt-8">
            <div className="text-2xl font-semibold mb-5">{titleText}</div>
            <div className="w-full flex justify-between space-x-4">
                {
                    cardsData.map(item =>{
                        return( 
                        <Card
                            title={item.title}
                            description ={item.description} 
                            imgUrl={item.imgUrl} 
                        />
                        );
                    })
                }              
            </div>
        </div>
    );
};

const Card = ({title, description, imgUrl}) =>{
    return(
        <div className="bg-black bg-opacity-40 w-1/5 p-4 rounded-lg">
            <div className="pb-4 pt-2">
                <img 
                    className="w-full rounded-md"
                    src={imgUrl}
                    alt ="label"
                />
            </div>
            <div className="text-white font-semibold py-3">{title}</div>
            <div className="text-gray-500 text-sm"> {description}</div>
        </div>
    )
}
export default Home;